import logo from '../../resources/images/w807_logo.png';
import { StyledDiv } from './DescriptionSection.styled';

export function DescriptionSection() {
  return (
    <StyledDiv>
      <img style={{ flex: '0 0 30%' }} src={logo} alt='w807 logo' />
      <div className="description-section" style={{ flex: '1' }}>
        <h2>Welcome to the W807 Homepage</h2>
        <p>We are a Milsim group focused on Ready or Not and Ground Branch.</p>
        <p>We strive for realism and to provide an immersive experience to our operators. Our team comprises people from different countries, backgrounds and skill sets, with this we strongly believe it gives us an edge and provides an extra layer when it comes to combat simulation.</p>
        <p>Feel free to take a look at our galleria where we post photos from past operations, trainings and others.</p>
        <p>If you decide you want to join the team proceed to join our discord.</p>
        <p>Good luck!</p>
      </div>
    </StyledDiv>
  );
}
